def A(n):
   counter = 0
   S = 0
   q = n
   while q:
      q, c = q//10, q % 10
      S += (-1)** counter * c
      counter += 1
   return S ** counter
def fixed_points_of_A():
   for i in range(1,100):
      m = int(10 ** (1 - 1/ i)) +1
      for k in range(m, 10):
         n = k**i
         e = A(n)
